import React from 'react';

class Login extends React.Component {
    render() {
        return (
            <form>
                <label>
                    Email:
                    <input type="text" placeholder="email@email.com"/>
                </label>
                <label>
                    Senha:
                    <input type="text" placeholder="Senha"/>
                    <input type="submit"/>
                </label>    

            </form>
        )
    }
}

export default Login
